import React, { createContext } from "react";

import Sidebar from "./Components/Sidebar";
import NoteList from "./Components/NoteList";

import './App.css';

const UserContext = createContext("Jamie");

function App() {

  return (
    <UserContext.Provider>
      <div className="App">

        {/* sidebar */}
        <div id="sidebar">
          <Sidebar />
        </div>

        {/* main content */}
        <div id="main">
          <NoteList />
        </div>

      </div>
    </UserContext.Provider>
  );
}

export default App;
